class UmHymnsUlimaWoKaliye {
  static List<HymnsContent> list = [
    HymnsContent(id: 3119, position: 1, content: "Suku wa tu iha vali\nUlima wokaliye.\nTu tumbangiyi ohenda\nLunene waye wa lua.\nKulima wa pita ale\nWa tu endisile ciwa.\nKulima wokaliye\nO linga Usongui wetu.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_356, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3120, position: 2, content: "Kovaso yoloneke\nNda kuiya ovitangi.\nKa tu vi yokokela\nTu kala lekolelo.\nTu kuete ohuminyo\nYa Yesu Cime cetu.\nHati, Nda yula oluali;\nLenevo wu ka yula.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_356, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3121, position: 3, content: "Suku ka yanduluka\nOmanu vo kolela.\nO va popela vosi\nKohele lokohali.\nNdaño olonjila vietu\nVi pita kovisaki.\nU tuo kolela tu wi,\nLacimue ci tu nyola.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_356, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3122, position: 4, content: "Suku o malusula\nUpange waye wosi;\nLetu ka tu ka kali\nLowesi pamue epipi.\nTu litumbiki ocili\nLesanju lekolelo.\nOco ulima ulo\nU piãle alima osi.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_356, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3123, position: 1, content: "Unyamo ukuavo,\nWa pita ño ndonjoi.\nSuku wa ndava lohenda.\nSia nyolehele mbu.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_357, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3124, position: 2, content: "Unyamo wa pita,\nA Suku, ngecele.\nAkandu osi nda linga.\nLoku njelisa pe.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_357, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3125, position: 3, content: "Unyamo wiyako,\nA Suku, ñolise,\nSi amiko oku tekela.\nKesunga lombembua.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_357, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3126, position: 4, content: "Anyamo ange osi,\nEci a pua, a Suku.\nNambule kimbo liutanya.\nUna ka wimuha.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_357, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3127, position: 1, content: "Ya tola ongula, ya pita\nKueya ulima wokaliye;\nTu amamiko ohele mbu\nOku yaka longusu.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_358, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3128, content: "Ulima wa pita ka tu umoli vali;\nEtali tua tambula ulima ukuavo!\nVanji ocali Suku a tuiha.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_358, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3129, position: 2, content: "Eteke keteke Kristu usongui,\nTu pongolole ovitima.\nTu kuete esanju lepuyuko,\nTua kolela eka lia’e.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_358, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3130, position: 3, content: "Kakandu tua yovoka,\nTua tiamela ku Yesu.\nOmuenyo, lupange viokaliye,\nTu kuete kekulusu lia’e.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_358, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3131, position: 4, content: "Ovisungo tu wimbili\nTu sivayi Yehova.\nTua tambula ulima ukuavo\nUsapula ohenda Ya’e.", hymnsNumber: UmHymnsNumberSeeder.ULIMA_WO_KALIYE_358, typeStanza: HymnsContentCode.VERSE),
  ];
}